import { useState } from "react";
import React from 'react';

const Home=()=>{
    const[name,setName]=useState(()=>{
        fname
    });
    
    const passData=(e)=>{
        // alert(e.target.value);
        e.preventDefault();
       alert("form submitted");
    }
    const inputEvent=(e)=>{
        // alert(e.target.value);
        setName(e.target.value);
    }
    return(
        <>
        <div className="split left">
            <div className="centered">
                <h1>Welcome Everyone</h1>
                <p>Register here for login to our website</p>
            </div>
        </div>
        <div className="split right">
            <div className="centered container">
                <form onSubmit={passData}>
                    <div className="row">
                        <div className="col-25">
                            <label><b>FullName:</b></label>   
                        </div>
                        <div className="col-75">
                            <input type="text" name="Fullname" onChange={inputEvent} placeholder="Full Name" value={name}/>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-25">
                            <label><b>Email:</b></label>   
                        </div>
                        <div className="col-75">
                            <input type="text" name="Email" onChange={inputEvent} placeholder="Email"/>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-25">
                            <label><b>Username:</b></label>   
                        </div>
                        <div className="col-75">
                            <input type="text" name="Username" onChange={inputEvent} placeholder="Username"/>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-25">
                            <label><b>Password:</b></label>   
                        </div>
                        <div className="col-75">
                            <input type="password" name="Password" onChange={inputEvent} placeholder="Password"/>
                        </div>
                    </div>
                    <hr/>
                    <button type="submit" >Sign Up</button>
                </form>
            </div>
           
        </div>
        </>
    )
}
export default Home;
